DROP TABLE IF EXISTS `tb_student`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_student` (
                              `STUDENT_NO` varchar(10) NOT NULL COMMENT '학생 번호',
                              `DEPARTMENT_NO` varchar(10) NOT NULL COMMENT '학과 번호',
                              `STUDENT_NAME` varchar(40) NOT NULL COMMENT '학생 이름',
                              `STUDENT_SSN` varchar(14) DEFAULT NULL COMMENT '학생 주민번호',
                              `STUDENT_ADDRESS` varchar(200) DEFAULT NULL COMMENT '학생 주소',
                              `ENTRANCE_DATE` datetime DEFAULT NULL COMMENT '입학 년도',
                              `ABSENCE_YN` char(1) DEFAULT NULL COMMENT '휴학 여부',
                              `COACH_PROFESSOR_NO` varchar(20) DEFAULT NULL COMMENT '지도 교수 번호',
                              PRIMARY KEY (`STUDENT_NO`),
                              KEY `FK_STUDENT_01` (`DEPARTMENT_NO`),
                              KEY `FK_STUDENT_02` (`COACH_PROFESSOR_NO`),
                              CONSTRAINT `FK_STUDENT_01` FOREIGN KEY (`DEPARTMENT_NO`) REFERENCES `tb_department` (`DEPARTMENT_NO`),
                              CONSTRAINT `FK_STUDENT_02` FOREIGN KEY (`COACH_PROFESSOR_NO`) REFERENCES `tb_professor` (`PROFESSOR_NO`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
